(31, 'dsfgsdfgsdfgsddfgsdfgsdfgsdfgsdfgsdfg', '<p>&nbsp;rgsdfg sdfg dfgdfgsd</p>\n\n<p>df gsdfgsdfgsdfgs df gbxcv bsdshtheh gvbxcv bxcvb cvb vcbx cbx cv dfgsdfnnbbn xvbvcbcx</p>\n\n<p>fd gsdfgertdfgndrur6uetyh g fgdfbcv bxcvbxc vbx cvb xcvbxcvb sdfd vxcv zxcv xc vxcvzx vrwtagg dzxzvxc</p>\n\n<p>vfg sdfgdfgcvbcvbn ghs g tert xcvz xcvdgasdfgvxcvzxcvasdfwe fb cv bvcxbvc fdgsdf ert bzxcv zxcvxczxczv&nbsp;</p>\n\n<p>&nbsp;</p>\n', 'dsfgsdfgsdfgsddfgsdfgsdfgsdfgsdfgsdfg', 25, 2, 1),
(32, 'Despre noi', '<p>Orelul cu aceast denumire e menionat documentar ca sat la 20 martie 1545, c&acirc;nd Alexandru Voievod, domnul Moldovei, confirm mnstirii Pobrata o jumtate de moie pe care clugrii o aveau &icirc;n dar de la jup&acirc;neasa Friman cu satul Curluceni. La 4 iulie 1774 &icirc;l aflm &icirc;n stp&acirc;nirea mnstirii Frumoasa, cu 84 de gospodrii cu rzei i mazili. Oraul avea 2 preoi, biserica a fost construit &icirc;n anul 1785, alturi de alta veche. Sat mare i frumos, &icirc;n anul 1870 aici erau 596 gospodrii, 1840 brbai i 1110 femei. Gospodarii ineau prisci, vii i livezi frumoase, erau lemnari, t&acirc;mplari vestii. La 6 ianuarie 1873 zemstva judeean trimite la Streni primul medic cu studii superioare, pe doctorul Feodor Constantinovichi Scordeli. La 1 iulie 1877 satul avea o bibliotec steasc, uar &icirc;n anul 1910 avea 2 coli i o biseric.</p>\n\n<p>Din spusele celui mai btr&acirc;n locuitor din ora I. urcanu &icirc;n v&acirc;rst de 98 de ani, care a auzit din mrturisirile</p>\n\n<p><img src="http://localhost/apps/frontend/views/templates/Default/assets/img/logo.png" style="margin:15px 0px 35px" /></p>\n\n<p>Din spusele celui mai btr&acirc;n locuitor din ora I. urcanu &icirc;n v&acirc;rst de 98 de ani, care a auzit din mrturisirile bunicului su, c undeva pe dealul Conei, un oarecare Teofan, strger, a construit o cas &icirc;n care stteau strgerii ce vegheau Chiinul. Cu toi strgerii conducea &icirc;nsi Teofan. Odat cu apariia localitii, de la cuv&acirc;ntul strgeri s-a tras toponimul Streni.</p>\n\n<p>Localitatea, &icirc;ncep&acirc;nd cu a doua jumtate a sec. XX, s-a dezvoltat intens, devenind un centru industrial important din republic.</p>\n\n<p>&Icirc;n oraul Streni sunt &icirc;nregistrai circa 2780 ageni economici, dintre care cel mai mare numr &icirc;l constituie gospodriile rneti &ndash; 1.590. &Icirc;ntreprinderile cu dreptul de persoane juridice alctuiesc 305 uniti. Un loc de frunte ocup industria alimentar, mai ales cea vinicol. Streniul se bucur de un spectru bogat al celor mai bune soiuri de poam european: Aligote, Pinot, Cabernet, Izabelle, Risling de Italia, coniacuri, din care se obine ampanie, vinuri seci ordinare i dulci de calitate superioar i sucuri naturale. Partea industrial a oraului este amplasat &icirc;n regiunea de nord-vest a oraului i este desprit de sectorul locativ prin calea ferat. Punctul de vinificaie, secia de crmid a fabricii de materiale de construcie se afl &icirc;n partea de nord a oraului. &Icirc;n domeniul comerului activeaz 96 &icirc;ntreprinderi, sistemul de alimentaie public este format de 25 &icirc;ntreprinderi. Deservirea social este asigurat de 17 uniti de deservire.</p>\n\n<p>&Icirc;n ora activeaz filiale ale 3 bnci comerciale i ale 2 companii de asigurare.</p>\n\n<p>Este dezvoltat producia de vinuri: . Se produc conserve din fructe i legume i produse de panificaie. Fabrica materialelor de construcie produce igl roie, faian. La 6 km spre sud-vest funcioneaz antena TV de l&acirc;ng Streni.</p>\n', 'Despre-noi', 26, 1, 1),
(33, 'Despre noi', '', 'Despre-noirewrwerwe', 26, 2, 1),
